        mapping(uint256 => uint256) storage all = _ownedTokens[owner];

        uint256 tokenCount = ERC721.balanceOf(owner) ;

        if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            for (uint256 i = 0; i < tokenCount; i++) {
                    result[i] = all[i];
            }
            return result;
        }
    }
    function _getAllToken() internal view returns (uint256[] memory _tokenID, address[] memory _Address) {
        uint256 tokenCount = _allTokens.length;
        address[] memory _Address = new address[](tokenCount);
        for (uint256 i = 0; i < tokenCount; i++) {
            _Address[i] = ownerOf(_allTokens[i]);
        }
        return (_allTokens,_Address);
    }

}

